・湿度：0～100％ <br><br>

目盛<br>
・温度：2℃<br>
・湿度：2％ <br><br>

材質<br>
・本体/目盛板カバー：ポリスチレン樹脂<br>
・目盛板：鉄<br>
・針：アルミ <br>
