JBウエルド超強力タイプ<br>
オートウエルド<br>
<br>
溶接並みの強力接着！<br>
一般の接着剤では無理な壊れた部品とか接着にピッタリのJBウエルド！<br>
鋳鉄・アルミ・鉄・真鍮・銅・木・石・ガラス・FRP・プラスチックなど硬いものならなんでもOK！<br>
2液を同一量絞り出し、均一になるまで混ぜて使用します<br>
硬化後は、アルミのような外観となります<br>
研磨・ドリル・ねじ切り可能<br>
<br>
耐熱温度：300℃<br>
実用硬化時間：約6時間（10℃にて）<br>
完全硬化時間：約24時間（10℃にて）<br>
接着力：約300kg/cm2<br>
正味量：53.6g（26.8g×2）<br><img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
